define("_KMS_ISP_HOSTINGS_SERVERS_TERMS","<h3>Orokorrak - Aplikazio Eremua</h3><p>Ondorengo baldintzak eta baldintzak aplikatzen dira bezeroaren eta Intergrid (Opengea) (aurrerantzean \"Intergrid\") arteko merkataritza-harreman guztietan. Eskaintza onartzen den unean indarrean dagoen legea kontratua arautuko du. Baldintza osagarriak edo kontrakoak ez dira kontratuaren parte izango, baldin eta beren baliozkotasuna berariaz adosten ez bada.</p><p><strong>Kontratuaren amaiera</strong></p><p>Gure eskaintzak aldaketak izan ditzakete. Arrazionalak direnean, aldaketa teknikoak eta bestelakoak egiteko eskubidea gordetzen dugu. Bezeroak eskaintzan adierazten duen eskaintza behin-behinekoa da. Bezeroaren eskaera jaso eta gauzatzean berretsiko dugu. Berrespena ez da kontratua. Berrespena eta kontratuaren onarpena elkarrekin egon daitezke. Kontratu-eskaintza (eskaera) onartzeko eskubidea gordetzen dugu jasotako hurrengo 5 lanegunetan. Intergrid-ek bezeroaren fidagarritasuna aztertu ondoren eskaera ukatzeko eskubidea ere badu.</p><p><strong>Zerbitzuen esparrua</strong></p><p>Gure Datu Zentroaren azpiegiturarako urteko batez besteko sarearen erabilgarritasuna %99koa dela bermatzen dugu. Zerbitzu-mailaren akordioa (SLA) bermearen moduan aplikatzen da. Hornidura-sarearen segurtasuna edo sarearen osotasunaren mantentzea arriskuan badago, zerbitzuaren sarbidea aldi baterako murriztu dezakegu beharrezkoa denean. Zerbitzaria Alemanian dagoen Datu Zentro batean dago, ekipamendua eta segurtasuna babesteko sarbide fisiko ezin hobearekin. Zerbitzari dedikatuei dagokienez, bezeroak zerbitzarien baliabide guztiak izango ditu: prozesamendua, biltegiratzea, memoria eta sarea, baita root sarbidea ere. Eskaintzen diren zerbitzuak eskaera gauzatzen den unean indarrean daudenak dira. Bezeroak bilatzaileetan (Interneteko edukiaren bilatzaileak) erregistratu nahi badu, Intergrid ez da bitartekaritza horren arduraduna. Bilatzaileen operadoreak dira bilaketa-motorrean sartzeko datuak eta unea zehazten dutenak. Zerbitzaria sare interkonektatuen jabetzakoa izango da, ordenagailu osagaien mantentze-lanen arduraduna eta hardware osagaien funtzionamendu egokiaren arduraduna izanik. Zerbitzarian exekutatzen diren aplikazioei lotutako software eta laguntza teknikoa ez da zerbitzari dedikatuen ostatu-eskaintzetan sartzen. Bezeroak zerbitzu horiek behar edo nahi baditu, aparte kobratuko dira.</p><p><strong>Datuen osotasuna</strong></p><p>Intergrid-ek aldizka egiten ditu segurtasun-kopiak, eskaintzaren parte denean. Datu-galera gertatuz gero, Intergrid-ek ahalik eta azkarren leheneratuko du datuen azken segurtasun-kopia, normalean 24 orduko epean eta bezeroaren aurretiko baimenarekin. Segurtasun-kopia zerbitzuak espazio mugatua du. Baldintzak eta maiztasuna eskaintzan zehazten dira. Bezeroak datuen segurtasun-kopia osoa egin behar du edozein aldaketa egin aurretik. Bezeroak erabiltzaile ID bat eta pasahitz bat jasoko ditu segurtasun-arrazoiengatik. Honek konfidentziala izan behar du. Bezeroa arduratzen da pasahitzaren erabilera ez baimenduaren ondorioz sortutako kalteez. Bezeroak jakiten badu hirugarrenek pasahitza ezagutzen dutela, berehala jakinarazi behar digu. Bezeroak pasahitzaren erabilera okerraren errua badu, hirugarrenek eragindako erabiltzaileen kuoten eta kalteen arduraduna izango da. Susmorik izanez gero, bezeroak pasahitz berria eska dezake Intergrid-en.</p><p><strong>Datu pertsonalen babesa</strong></p><p>Gure datu-babesaren praktika Europako datu pertsonalen babesari buruzko legearekin eta konfidentzialtasunarekin bat dator, Europako Parlamentuaren eta Kontseiluaren 1995eko urriaren 24ko 95/46/EE Zuzentaraua betez. Bezeroaren datu pertsonalak soilik erabiliko dira kontratu-harremana sortzeko, edukia antolatzeko edo aldatzeko beharrezkoa denean. Bezeroak bere datu pertsonalen aldaketak eguneratzeko edo jakinarazteko betebeharra du Intergrid-i. Bezeroaren posta elektronikoko helbidea eskaerei, fakturei buruzko informazioa jasotzeko erabiliko da, eta, bezeroak aurka egin ezean, bezeroarentzako arreta emateko, baita gure buletinari buruz ere, bezeroak hala nahi badu. Intergrid-ek ez ditu bezeroen datu pertsonalak hirugarrenei ematen, zerbitzu-laguntzaileei izan ezik, bezeroarekin ordainketa eta likidazioak zehazteko beharrezkoak diren neurrian. Bezeroak informazioa izateko eta bere gordetako informazioa aldatzeko, eteteko edo ezabatzeko eskubidea du. Ezabatzeko betebeharrak legezko edo kontratuzko gordetze-betebehar batekin edo beste arrazoiengatik bat ez badatoz, informazioa eskuragarri ez egingo da.</p><p><strong>Argitaratutako edukiak</strong></p><p>Bezeroaren ardura da Interneteko edukiaren berezko edo hirugarrenen edukitzat identifikatzea. Bezeroaren izen osoa eta helbidea aurkeztu behar dira. Beste betebehar batzuk Telekomunikazioen Legearen eta Teleservizioen Legearen xedapenek eragin ditzakete. Bezeroak xedapen horiek aztertu eta betetzeko betebeharra du. Bezeroak ez du edukirik argitaratuko hirugarrenen eskubideak urratzen dituen edo legea urratzen duenik. Material erotikoa, pornografikoa edo material ez-zentzugabea argitaratzea debekatuta dago. Eskubidea dugu arau hori urratzen duen bezeroaren kontuaren sarbidea blokeatzeko. Gauza bera gertatzen da bezeroak banako edo talde baten eskubideak urratzen dituen edukiak argitaratzen baditu, edo pertsona horiek iraintzen edo denigratzen baditu. Hau legezko eskari errealik gabe ere aplikatzen da. Ez dugu gure bezeroen edukia berrikusteko betebeharrik. SPAM bidaltzea debekatuta dago. Honek, bereziki, hirugarrenei publizitate ilegala, ez-eskatua bidaltzea barne hartzen du. Posta elektronikoaren bidalketari dagokionez, debekatuta dago bidaltzailearen informazio faltsua ematea edo bidaltzailearen identitatea beste bide batzuen bidez ezkutatzea. Eskubidea dugu sarbidea blokeatzeko, baldin eta ez bada errespetatzen.</p><p><strong>Erantzukizuna</strong></p><p>Ez dugu inolako erantzukizunik hartzen gure eragin-esferatik kanpo dauden arazo tekniko eta interneteko aldaketengatik eragindako kalte zuzen, kalte sekundario edo diru-sarreren galerengatik. Kontratistari dagokionez, ez gara arduratzen kontratu-betebeharren arinkeriaz arduragabetasunagatik. Hau ez da aplikatzen lesio pertsonal kasu guztietan eta produktu akastunengatik erantzukizun legearekin bat dator. Kalte emergente eta irabazi galerengatik, soilik arduratzen gara asmo txarrez edo arduragabekeria larriaz. Kasu horretan, kontratu tipikoaren aurreikusitako kalteen ardura izango dugu, urteko kuotaren %100eko gehienezko zenbatekoarekin. Bezeroaren web edukia betebeharren 6. paragrafoaren urraketa bada, batez ere legezko edo moraleko debekuak urratzean, Intergrid-ek eragindako kalte guztiak, zuzenak eta zeharkakoak barne, arduraduna izango da. Gainera, bezeroak legez kanpoko edukietatik eratorritako hirugarrenen erreklamazio guztietatik askatzeko konpromisoa hartzen du, mota edozein dela ere. Askatzeko betebeharrak defentsa juridikoko gastu guztiak barne hartzen ditu (adibidez, auzitegi eta abokatuen ordainsariak).</p><p><strong>Ordainketa-baldintzak</strong></p><p>Indarrean dagoen prezioa fakturazioaren unean argitaratutakoa da, gehi legezko BEZa. Aldez aurretik jakinarazi ezean, fakturak eskaera jaso ondoren berehala ordaindu behar dira. Faktura osorik edo partzialki ordaintzen ez bada, berankortasun-interesak zor dira lege-interes-tasa nagusiaren arabera, ezarritako legeari jarraituz. Bezeroak bakarrik ordaindu dezake gure edo hirugarrenek gure izenean emandako erreklamazioengatik. Bezeroaren zorrak bakarrik konpentsa daitezke baliozkoak eta zalantzarik gabeak badira.</p><p><strong>Epea</strong></p><p>Zerbitzuak hiru hilabeteko epe finkoetarako eskaintzen dira eta hurrengo hiru hilabetez automatikoki berrituko dira epea amaitu baino 4 aste lehenago kontratua idatziz bertan behera uzten ez bada. Intergrid-ek zerbitzua bertan behera uzteko edo arrazoirik gabeko berrespena baztertzeko eskubidea du hilabete jakin batean hilabete aurretik. Bertan behera uzteak edozein hirugarren zerbitzu-hornitzaileen kontratuarekin lotutako betebeharrak barne hartzen ditu, bezeroarekin hitzartuta, batez ere domeinu-izenaren erregistroa besteak beste. Bertan behera uztearen ondorioz, bezeroaren datu guztiak ezabatu ahal izango dira.</p><p><strong>Aldaketak baldintza orokorretan</strong></p><p>Intergrid-ek baldintza orokor hauek edozein unetan aldatzeko eskubidea gordetzen du. Aldaketak posta elektronikoz edo zerbitzuarekin batera bidaliko dira. Bezeroak aldaketen aurka egin ezean jakinarazpena jaso eta hurrengo bi asteetan, aldaketak onartuak izan direla ulertuko da.</p><p><strong>Azkenean</strong></p><p>Erabilera-baldintza hauek eta bezeroaren arteko harreman guztiak Alemaniako legearen arabera izango dira. Alemaniako Frankfurt (Main) eskualdeko epaitegiak izango dira gatazken erantzule bakarrak. Baldintza hauen atal bakar bat baliogabea bada edo indargabetzen bada, gainerako atalek bere balioa mantenduko dute. Partaideek xedapen baliogabea berriro adostuko dute, alde biek beren asmo ekonomikoa betetzeko.</p>",$case);
