define("_KMS_ISP_HOSTINGS_TERMS","<ul><li>El cliente tiene derecho a modificar los l&iacute;mites de su hosting siempre que lo desee a trav&eacute;s del Panel de Control.</li><li>En el momento en que el cliente realice una ampliaci&oacute;n en los l&iacute;mites del contrato de hosting, INTERGRID emitir&aacute; autom&aacute;ticamente una factura en concepto de la ampliaci&oacute;n y con un importe de la diferencia entre los nuevos recursos asignados y los recursos previamente facturados.</li><li>Los cambios efectuados tienen un efecto inmediato en las condiciones del alojamiento.</li><li>En caso de reducci&oacute;n de l&iacute;mites, INTERGRID no realizar&aacute; ning&uacute;n abono de cualquier factura anterior que ya se haya emitido. La nueva cuota quedar&aacute; reflejada en la pr&oacute;xima factura que se emitir&aacute; en la fecha del vencimiento de contrato.</li><li>En el momento en que el cliente supere el l&iacute;mite de espacio o trasnsfer&egrave;ncia establecido en el contrato, se notificar&aacute; v&iacute;a email al cliente. El cliente dispondr&aacute; de un m&aacute;ximo de 30 d&iacute;as a partir de la recepci&oacute;n de la notificaci&oacute;n para ajustar los nuevos l&iacute;mites o reducir de nuevo el consumo de recursos por debajo del l&iacute;mite establecido. En caso de que el cliente pasados â€‹â€‹30 d&iacute;as, y los recursos consumidos sigan superando l&iacute;mites contratados, INTERGRID emitir&aacute; una factura correspondiente a los recursos extras consumidos. La tarificaci&oacute;n que se aplicar&aacute; en este caso es de 1 &euro; / mes por GB adicional, tanto en el espacio como por la transferencia.</li></ul>",$case);
